    class Card
    {
        public Card(string nameCard, string nameSuit)
        {
            Name = nameCard;
            Suit = nameSuit;
        }

        private string Name { get; }

        private string Suit { get; }

        public void Show()
        {
            Console.Write($"{ Name }{ Suit } ");
        }
    }

    class Deck
    {
        private static Random _random = new Random();

        private DeckGenerator _deckGenerator = new DeckGenerator();
        private List<Card> _cards;

        public Deck()
        {
            _cards = _deckGenerator.CreateCards();
            Shuffle();
        }

        public void ShowCards()
        {
            if (_cards.Count > 0)
            {
                Console.WriteLine("Карты в колоде");

                foreach (Card card in _cards)
                {
                    card.Show();
                }
            }

            else
                Console.Write("Колода карт пуста, вы забрали все карты!");

        }

        public bool TryGetCard(out Card card)
        {
            card = null;

            if (_cards.Count > 0)
            {
                card = _cards[0];

                _cards.Remove(card);
                return true;
            }

            else
                Console.WriteLine("Колода какрт пуста, вы забрали все карты!");

            return false;
        }

        private void Shuffle()
        {
           
            for (int i = 0; i < _cards.Count; i++)
            {
                Card buffer = _cards[i];

                int index = _random.Next(_cards.Count);

                _cards[i] = _cards[index];
                _cards[index] = buffer;
            }
        }
    }

    class DeckGenerator
    {
        private readonly List<string> _names = new List<string>() { "6", "7", "8", "9", "10", "В", "Д", "К", "Т" };

        private readonly List<string> _suits = new List<string>() { "♠", "♣", "♦", "♥" };

        public List<Card> CreateCards()
        {
            List<Card> cards = new List<Card>();

            for (int i = 0; i < _suits.Count; i++)
            {
                for (int j = 0; j < _names.Count; j++)
                {
                    cards.Add(new Card(_names[j], _suits[i]));
                }
            }

            return cards;
        }
    }
}

