int divPrim(int n, int &s)
{
    int d=2, p;
    s=0;
    while(n!=1)
    {
        //cout<<"#";
        p=0;
        while(n%d==0)
        {
            p++;
            n=n/d;
        }
        if(p%2==1)
            s+=d;
        d++;
    }
    return s;
}

