static inline T powt10(T num) 
{
	return tabp10[num];
}

//integer log10
static inline int logt10(__uint64_t n)  
{  
    return 
		(n < tabp10[1] ? 0 :   
        (n < tabp10[2] ? 1 :   
        (n < tabp10[3] ? 2 :   
        (n < tabp10[4] ? 3 :   
        (n < tabp10[5] ? 4 :   
        (n < tabp10[6] ? 5 :   
        (n < tabp10[7] ? 6 :  
        (n < tabp10[8] ? 7 :  
        (n < tabp10[9] ? 8 :  
		(n < tabp10[10] ? 9 :   
        (n < tabp10[11] ? 10 :   
        (n < tabp10[12] ? 11 :   
        (n < tabp10[13] ? 12 :   
        (n < tabp10[14] ? 13 :   
        (n < tabp10[15] ? 14 :   
        (n < tabp10[16] ? 15 :  
        (n < tabp10[17] ? 16 :  
        (n < tabp10[18] ? 17 :  
		(n < tabp10[19] ? 18 :   
        (n < tabp10[20] ? 19 :   
        20
		))))))))))))))))))))
	;
}

//double any substring of a number
static inline uint64_t brusselDouble(uint64_t n, uint64_t offsetLeft/*offset left*/, uint64_t length/*length*/){
	uint64_t prefix=  n/powt10(offsetLeft+length) *powt10(offsetLeft+length); 	//substring prefix
	uint64_t suffix = n%powt10(offsetLeft); 									//substring suffix

	uint64_t tnum  = n %powt10(offsetLeft+length) /powt10(offsetLeft); 	   		//parse target number
	uint64_t tnum2 = tnum<<1; 						//double
	prefix*=powt10(logt10(tnum2)-logt10(tnum));		//compensate magnitude difference
	tnum2 *=powt10(offsetLeft); 					//trailing zeros

	uint64_t out = prefix+tnum2+suffix; 			//concatenate

	return out;
}

//divide any substring of a number
static inline uint64_t brusselDivide(uint64_t n, uint64_t offsetLeft, uint64_t length){
	uint64_t prefix = n/powt10(offsetLeft+length) *powt10(offsetLeft+length); 	//substring prefix
	uint64_t suffix = n%powt10(offsetLeft); 									//substring suffix

	uint64_t tnum  = n%powt10(offsetLeft+length) /powt10(offsetLeft); 	   		//parse target number
	uint64_t tnum2 = tnum>>1; 					//halve
	bool frac = isodd(tnum);
	prefix/=powt10(logt10(tnum)-logt10(tnum2));	//compensate magnitude difference
	tnum2 *=powt10(offsetLeft); 				//trailing zeros

	uint64_t out = prefix+tnum2+suffix;			//concatenate

	return (!frac)*out ;
}

#include <iostream>
//fast but not optimal
#include <unordered_map>
#include <queue>
#include <vector>
#include <algorithm>
#include "baseten.h"

using namespace std;

unordered_map<uint64_t, tuple<uint8_t, uint8_t, bool >> steps; // steps[num] offset, length, operation(0=dobl 1=half)


// Function to find the minimal number of steps to reach m from n using Choix de Bruxelles rules
vector<uint64_t> brusselSearch(uint64_t n, uint64_t m) {
    queue<uint64_t> branch;

	steps[m]={0,m,1};
    branch.push(m);

    while (!branch.empty()) {
        uint64_t curr = branch.front();
        branch.pop();

        if (curr == n) {
            // Reconstruct the steps sequence, repeat steps in reverse
            vector<uint64_t> sequence;
            while (curr != m) {
                sequence.push_back(curr);
                bool operation = get<2>(steps[curr]);
                if (operation==0) {
                    curr = brusselDouble(curr, get<0>(steps[curr]), get<1>(steps[curr]));
                } else if (operation==1) {
                    curr = brusselDivide(curr, get<0>(steps[curr]), get<1>(steps[curr]));
                }
            }
            sequence.push_back(m);

            return sequence;
        }

        // Generate new numbers by doubling or dividing substrings
        int currLen = logt10(curr)+1;
        for (size_t i = 0; i < currLen; i++) {
            for (size_t j = i + 1; j <= currLen; j++) {
                uint64_t newNum = brusselDouble(curr, i, j-i);
                if (newNum != curr && steps.find(newNum) == steps.end()) {
					int magDif = ( (int)logt10(newNum)-(int)logt10(curr) ); // magnitude difference for reconstructing sequence, 0 or doubling +1 or halving -1
                    steps[newNum] = {i, j-i+magDif, 1}; //{offset, len+magdif, inverse operation} rules to go back from newNum to curr
                    branch.push(newNum); //insert to queue
                }

                newNum = brusselDivide(curr, i, j-i);
                if (newNum != 0 && newNum != curr && steps.find(newNum) == steps.end()) {
					int magDif = ( (int)logt10(newNum)-logt10(curr) );
                    steps[newNum] = {i, j-i+magDif, 0};
                    branch.push(newNum);
                }
            }
        }
    }

    // If no path is found
    return vector<uint64_t>();
}

int main(int argc, char** argv){
    uint64_t start = 64;
    uint64_t target = 1;

	if( argc>1 ){
		start = stoll(argv[1]);
	}
	if( argc>2 ){
		target = stoll(argv[2]);
	}

	vector<uint64_t> sequence = brusselSearch(start,target);

    if (!sequence.empty()) {
        cout << "Steps: " << sequence.size() << "\n";
        if(start>target){
            for (auto it = sequence.begin(); it != sequence.end(); ++it) {
                cout << *it << "\n";
            }
        }else{
            for (auto it = sequence.rbegin(); it != sequence.rend(); ++it) {
                cout << *it << "\n";
            }
        }

        cout << "\n";
    } else {
        cout << "No path found \n";
    }

    return 0;
}
